import React, { useState } from 'react';
import { Menu } from 'lucide-react';
import MouseTrail from './components/MouseTrail';
import Sidebar from './components/Sidebar';
import { SECTIONS } from './data';

url('data:image/png;base64,')
/* 
    2. REPLACE MAIN BACKGROUND BASE64 HERE 
   Paste your base64 string inside the url('') parentheses.
*/
const MAIN_BG_BASE64 = "url('data:image/gif;base64,R0lGODlhAQABAIAAAAAAAP///yH5BAEAAAAALAAAAAABAAEAAAIBRAA7')";

const App: React.FC = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);
  const [activeId, setActiveId] = useState(SECTIONS[0].id);

  const toggleSidebar = () => setSidebarOpen(!sidebarOpen);

  const scrollToSection = (id: string) => {
    setActiveId(id);
    setSidebarOpen(false); // Close sidebar on mobile after selection
    const element = document.getElementById(id);
    if (element) {
      element.scrollIntoView({ behavior: 'smooth' });
    }
  };

  return (
    <div 
      className="flex h-screen overflow-hidden bg-tang-bg text-tang-main font-serif relative bg-cover bg-center"
      style={{ backgroundImage: MAIN_BG_BASE64 }}
    >
      <MouseTrail />

      {/* Mobile Backdrop */}
      {sidebarOpen && (
        <div 
          className="fixed inset-0 bg-black/80 backdrop-blur-sm z-30 md:hidden"
          onClick={() => setSidebarOpen(false)}
        />
      )}

      {/* Mobile Toggle Button */}
      <button 
        onClick={toggleSidebar}
        className="fixed top-5 right-5 z-50 p-2 rounded bg-black/80 text-tang-gold border border-tang-gold/30 md:hidden hover:bg-black hover:border-tang-gold"
      >
        <Menu size={24} />
      </button>

      {/* Sidebar Component */}
      <Sidebar 
        sections={SECTIONS}
        activeId={activeId}
        isOpen={sidebarOpen}
        onNavigate={scrollToSection}
      />

      {/* Main Content Area */}
      <main className="flex-1 overflow-y-auto relative scroll-smooth p-6 md:p-10 custom-scrollbar">
        <div className="max-w-4xl mx-auto pb-24">
          <header className="text-center mb-10 md:mb-16">
            <h1 className="font-serif font-black text-4xl md:text-6xl text-transparent bg-clip-text bg-gold-gradient tracking-tight mb-2">
              
            </h1>
            <div className="font-cinzel font-extrabold text-tang-dim text-sm tracking-[4px]">
              CYBER TANG DYNASTY  PLAYER GUIDE
            </div>
          </header>

          {SECTIONS.map((section) => (
            <section key={section.id} id={section.id} className="mb-16">
              <div className="flex items-center text-tang-main text-2xl md:text-3xl font-extrabold border-b-2 border-tang-purple/40 pb-3 mb-6">
                <span className="text-tang-purple text-2xl mr-4 font-normal"></span>
                <h2>{section.title}</h2>
              </div>
              
              <div className="animate-fade-in-up">
                {section.content}
              </div>
            </section>
          ))}

          <footer className="text-center mt-20 text-[#666] font-cinzel opacity-60 text-sm">
            <p><br />  </p>
          </footer>
        </div>
      </main>
    </div>
  );
};

export default App;